		body {
			background: #101010;
			color: #f2f2f2;
			font-family: Abel;
			font-size: 12px;
		}

		body a {
			color: #3467BA;
			text-decoration: none;
		}

		body a:hover {
			text-decoration: underline;
		}

		#main_content {
			border: 1px solid #5C7296;
			overflow: hidden;
			width: 1000px;
			height: auto;
			padding: 15px;
			margin: 0 auto;
			background: #0A0A0A;
			border-radius: 6px;
			-moz-border-radius: 6px;
			-webkit-border-radius: 6px;
		}

		.enabled {
			color: #7ACC29;
		}

		.enabled a {
			color: #7ACC29;
			font-weight: normal;
		}

		.disabled {
			color: #CC0000;
		}

		.TableHeader_Name {
			width: 400px;
			padding: 0px 0px 0px 5px;
			height: 25px;
			font-family: Abel;
			background-color: #282828;
			border-top-left-radius: 4px;
			-moz-border-top-left-radius: 4px;
			-webkit-border-top-left-radius: 4px;
		}

		.TableHeader {
			width: 100px;
			height: 25px;
			font-family: Abel;
			text-align: center;
			background-color: #282828;
		}

		.TableHeaderoptions {
			padding: 0px 0px 0px 15px;
