			height: 25px;
			font-family: Abel;
			background-color: #282828;
			border-top-right-radius: 4px;
			-moz-border-top-right-radius: 4px;
			-webkit-border-top-right-radius: 4px;
		}

		.TableLast {
			padding: 0px 0px 0px 15px;
			width: 200px;
			height: 25px;
			font-family: Abel;
			background-color: #282828;
			border-top-right-radius: 4px;
			-moz-border-top-right-radius: 4px;
			-webkit-border-top-right-radius: 4px;
		}

		.filesize {
			color: green;
			text-align: center;
